import React from "react";

function QuizPublishedPopup() {
  return (
    <div
      style={{
        paddingBottom: "2vh",
        paddingTop: "2vh",
        paddingRight: "2.5vw",
        paddingLeft: "2.5vw",
        marginLeft: "3vw",
        backgroundColor: "white",
        borderRadius: "10px",
        width: "40vw",
      }}
    >
      <div
        style={{
          textAlign: "center",
          color: "#474444",
          fontSize: "2em",
          fontWeight: "600",
        }}
      >
        <p>Congrats your Quiz is </p>
        <p>Published!</p>
      </div>
    </div>
  );
}

export default QuizPublishedPopup;
